//-1none,0left,1top,2right,3bot
ss.bruterecur = function (str, dir, i, n) {
	var strr, a;
	if (str == ss.brutewin) { return [dir]; }
	if (n == 0) { return false; }
	if (dir != 2 && i % ss.mapw != 0) {
		strr = str.slice(0, i - 1) + "#" + str.charAt(i - 1) + str.slice(i + 1);
		if (a = ss.bruterecur(strr, 0, i - 1, n - 1)) { a.unshift(dir); return a; }
	}
	if (dir != 3 && i >= ss.mapw) {
		strr = str.slice(0, i - ss.mapw) + "#" + str.slice(i - ss.mapw + 1, i) + str.charAt(i - ss.mapw) + str.slice(i + 1);
		if (a = ss.bruterecur(strr, 1, i - ss.mapw, n - 1)) { a.unshift(dir); return a; }
	}
	if (dir != 0 && i % ss.mapw != ss.mapw - 1) {
		strr = str.slice(0, i) + str.charAt(i + 1) + "#" + str.slice(i + 2);
		if (a = ss.bruterecur(strr, 2, i + 1, n - 1)) { a.unshift(dir); return a; }
	}
	if (dir != 1 && i < (ss.maph - 1) * ss.mapw) {
		strr = str.slice(0, i) + str.charAt(i + ss.mapw) + str.slice(i + 1, i + ss.mapw) + "#" + str.slice(i + ss.mapw + 1);
		if (a = ss.bruterecur(strr, 3, i + ss.mapw, n - 1)) { a.unshift(dir); return a; }
	}

	return false;
}

ss.multisolve = function (n) {
	var a, b, c, d;
	a = ss.lastimport;
	ss.importmap(a);
	c = ss.solve(0);
	d = [[c, ss.movelist]];
	for (b = 0; b < n; b++) {
		ss.importmap(a);
		d.push([ss.solve(), ss.movelist]);
	}
	d.sort(function (a, b) { return a[0] - b[0]; });
	clog("old: " + c + ", new: " + d[0][0] + ", win: " + (c - d[0][0]));
	ss.importmap(a);
	ss.movelist = d[0][1];
	return c - d[0][0];
}

ss.testmultisolve = function (n, m) {
	var a, b, c, d;

	b = 0;
	for (a = 0; a < n; a++) {
		b += ss.multisolve(m);
	}
	clog(floor(b / n));

}

