ss.drawsolutions = function () {
	var status = "";
	if (ss.moveinterval || ss.overlayinterval) { setbuttontext("Stop"); }
	else if (ss.showlistoutput) { setbuttontext("Hide"); }
	else { setbuttontext("Guide"); }
	if (ss.solving) {
		if (ss.bestsolution) { status = "Solving, best: " + ss.bestsolution.length + " moves"; }
		else { status = "Solving..."; }
	}
	else {
		if (ss.bestsolution) {
			if (ss.moveinterval || ss.overlayinterval) { status = "Guide: " + ss.moveindex + "/" + ss.movelist.length; }
			else if (ss.bestsolution.length != 0) { status = "Solved, " + ss.bestsolution.length + " moves"; }
			else { status = "Puzzle complete"; }
		}
		else { status = "No solution"; }
	}
	setstatus(status);
}

ss.testrates = function (n, m, base, tut, best) {
	var a, b, c, base, tut, best;
	if (m == undefined) {
		base = 0;
		tut = 0;
		best = 0;
		m = n;
	}
	else {
		base += ss.basesolution.length;
		tut += ss.tutsolution.length;
		best += ss.bestsolution.length;
	}
	ss.shuffle(150);
	if (m >= 0) {
		setTimeout(function () { ss.testrates(n, m - 1, base, tut, best) }, 7000);
		clog("Test: " + (n - m) + "/" + n);
	}
	else {
		clog("==== test done, " + n + " runs ====");
		clog("tut: " + round(tut / n));
		clog("base: " + round(base / n));
		clog("best: " + round(best / n));
	}
}

ss.optimisemoves = function (movelist) {
	var a, b, c, d, str, trans, l, r, back;

	if (movelist.length == 0) { return movelist; }

	trans = ["0321", "1230", "1230", "1230", "0321", "1230", "1230", "1230"];//0321,1
	back = [[-1, 0], [0, -1], [1, 0], [0, 1]];

	str = "";
	for (a = 0; a < movelist.length; a++) {
		if (movelist[a].x1 > movelist[a].x2) { str += "0"; }
		if (movelist[a].y1 > movelist[a].y2) { str += "1"; }
		if (movelist[a].x1 < movelist[a].x2) { str += "2"; }
		if (movelist[a].y1 < movelist[a].y2) { str += "3"; }
	}

	while (true) {
		l = str.length;
		for (a in trans) {
			str = str.replace(/\d/g, function (b) { return trans[a][b]; });

			str = str.replace(/02/g, "");
			str = str.replace(/0123012/g, "10321");
			str = str.replace(/2123003212/g, "321123");
			str = str.replace(/1230032121/g, "032112");
			str = str.replace(/123003212/g, "0321123");
			str = str.replace(/3300122123000/g, "2303001");
			str = str.replace(/123030122/g, "3012123");

		}
		if (str.length == l) { break; }
	}

	l = [movelist[0].x1, movelist[0].y1];
	r = [];
	for (a = 0; a < str.length; a++) {
		r[a] = { x1: l[0], y1: l[1], x2: l[0] + back[str[a]][0], y2: l[1] + back[str[a]][1] };
		l = [r[a].x2, r[a].y2];
	}

	return r;
}

ss.findoptimisation = function (movelist1, movelist2) {
	var a, b, c, d, str2, str1, trans, back, start, end, r1, r2;

	trans = ["0321", "1230", "1230", "1230", "0321", "1230", "1230", "1230"];//0321,1
	back = [[-1, 0], [0, -1], [1, 0], [0, 1]];

	str1 = "";
	for (a = 0; a < movelist1.length; a++) {
		if (movelist1[a].x1 > movelist1[a].x2) { str1 += "0"; }
		if (movelist1[a].y1 > movelist1[a].y2) { str1 += "1"; }
		if (movelist1[a].x1 < movelist1[a].x2) { str1 += "2"; }
		if (movelist1[a].y1 < movelist1[a].y2) { str1 += "3"; }
	}
	str2 = "";
	for (a = 0; a < movelist2.length; a++) {
		if (movelist2[a].x1 > movelist2[a].x2) { str2 += "0"; }
		if (movelist2[a].y1 > movelist2[a].y2) { str2 += "1"; }
		if (movelist2[a].x1 < movelist2[a].x2) { str2 += "2"; }
		if (movelist2[a].y1 < movelist2[a].y2) { str2 += "3"; }
	}

	for (start = 0; start < str1.length && start < str2.length; start++) {
		if (str1[start] != str2[start]) { break; }
	}
	for (end = 0; end < str1.length && end < str2.length; end++) {
		if (str1[str1.length - end - 1] != str2[str2.length - end - 1]) { break; }
	}

	r1 = str1.slice(start, str1.length - end);
	r2 = str2.slice(start, str2.length - end);

	if (r1.length < 10) {
		clog("=== optimisation found ==");
		clog(addzeros(r1, r1.length + 1, " ", true), str1);
		clog(addzeros(r2, r1.length + 1, " ", true), str2);
	}
}

ss.trytogglesolution = function () {
	var guiding = ss.moveinterval || ss.overlayinterval;
	if (!guiding) {
		ss.stopsolve();
		ss.togglesolution();
	}
	ss.solutiontimer = false;
}

ss.togglesolution = function (newstate) {
	var solution = ss.moveinterval || ss.showlistoutput || ss.overlayinterval;

	if (newstate == undefined) {
		newstate = !solution;
	}

	if (!newstate) {
		ss.toggleanimate(false);
		ss.togglelistoutput(false);
		ss.toggleoverlayoutput(false);
		ss.drawsolutions();
		return;
	}

	if (localStorage.slidesolver_newuser != "false") {
		ss.togglesettings(true);
		localStorage.slidesolver_newuser = "false";
		return;
	} else {
		ss.togglesettings(false);
	}

	if (localStorage.slidesolver_outtype == ss.enum_slidesolver_outtype.voice) {
		ss.toggleanimate(true);
	}

	if (localStorage.slidesolver_outtype == ss.enum_slidesolver_outtype.list) {
		ss.togglelistoutput(true);
	}

	if (localStorage.slidesolver_outtype == ss.enum_slidesolver_outtype.overlay || localStorage.slidesolver_outtype == ss.enum_slidesolver_outtype.overlay2) {
		ss.toggleoverlayoutput(true);
	}

	ss.drawsolutions();
}

